package beecrowd;

import java.util.Random;

public class practicing_quicksort {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Random r = new Random();
		int[] a = new int[10];
		for(int i = 0; i<a.length; i++) {
			a[i] = r.nextInt(10);
			
		}
		for(int i = 0; i<a.length; i++) {
			System.out.println(a[i]);
			
		}
		

	}

}
